import React, { useState } from 'react';
import styled from 'styled-components';

const SearchBlock = styled.div`
width: 1024px;
height: 256px;

position: relative;
background: #EDEDED;

margin: 0 auto;
padding-top: 20px;
padding-left: 50px;

margin-top: 32px;
display: flex;
flex-direction: column;
`

function SearchPage() {
  const [sport, setSport] = useState('');
  const [region, setRegion] = useState('');
  const [reservation, setReservation] = useState('');

  const handleSearch = () => {
    // 종목과 지역에 따라 체육 시설을 검색하는 로직을 작성하세요.
    // 예를 들어, 서버와 통신하여 검색 결과를 가져오는 API 호출 등을 수행할 수 있습니다.
    // 가져온 검색 결과는 setSearchResults()를 통해 상태를 업데이트하세요.
    // setSearchResults([...newResults]); // 예시: 가져온 검색 결과를 상태에 업데이트

    // 여기서는 간단하게 검색 조건과 검색 결과를 콘솔에 출력하는 예시를 제공합니다.
    console.log('종목:', sport);
    console.log('지역:', region);
    console.log('예약:', reservation);
  };

  const handleClickRadioButton1 = (e) => {
    console.log(e.target.value)
    setSport(e.target.value)
  }

  const handleClickRadioButton2 = (e) => {
    console.log(e.target.value)
    setReservation(e.target.value)
  }

  return <SearchBlock>
    <div>
        종목
        &nbsp;&nbsp;&nbsp;&nbsp;
        <input
        type="radio"
        value="soccer"
        checked={sport ==="soccer"}
        defaultChecked="checked"
        onChange={handleClickRadioButton1}
        />
        <label> 축구 </label>
        &nbsp;&nbsp;
        <input
        type="radio"
        value="basketball"
        checked={sport ==="basketball"}
        onChange={handleClickRadioButton1}
        />
        <label> 농구 </label>
        &nbsp;&nbsp;
        <input
        type="radio"
        value="futsal"
        checked={sport ==="futsal"}
        onChange={handleClickRadioButton1}
        />
        <label> 풋살 </label>

        <br/><br/>
      <label>
        지역
        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <select value={region} onChange={(e) => setRegion(e.target.value)}>
          <option value="">선택하세요</option>
          <option value="서울">서울</option>
          <option value="부산">부산</option>
          <option value="인천">인천</option>
          <option value="대구">대구</option>
          <option value="광주">광주</option>
          <option value="대전">대전</option>
          <option value="울산">울산</option>
          <option value="경기">경기</option>
          <option value="강원">강원</option>
          <option value="충북">충북</option>
          <option value="충남">충남</option>
          <option value="전북">전북</option>
          <option value="전남">전남</option>
          <option value="경북">경북</option>
          <option value="경남">경남</option>
          <option value="제주">제주</option>
          <option value="세종">세종</option>

        </select>
      </label>
      <br/><br/>

      예약
        &nbsp;&nbsp;&nbsp;&nbsp;
        <input
        type="radio"
        value="all"
        checked={reservation ==="all"}
        defaultChecked="checked"
        onChange={handleClickRadioButton2}
        />
        <label> 전체 </label>
        &nbsp;&nbsp;
        <input
        type="radio"
        value="spor+ing"
        checked={reservation ==="spor+ing"}
        onChange={handleClickRadioButton2}
        />
        <label> Spor+ing </label>
        &nbsp;&nbsp;
        <input
        type="radio"
        value="other"
        checked={reservation ==="other"}
        onChange={handleClickRadioButton2}
        />
        <label> 외부사이트 </label>

        <br/><br/>

      <button onClick={handleSearch}>검색</button>
      </div>
    </SearchBlock>
}

export default SearchPage;
